import React from 'react';

class Arithmetic extends React.Component{
	constructor(props){
		super(props)
	}


	render(){
		return (
			<div>
				we learned on the <b className="pageName">variables page</b> how to create <b>integers</b> and <b>doubles</b>. on this page, we are going to use these two variable types in <b>arithmetic operations</b>. oooh, fancy right? not really. <b>arithmetic</b> is just a cool-sounding word for the study of numbers and operations on them, such as <b>addition</b>, <b>subtraction</b>, <b>multiplication</b>, and <b>division</b>. here are the five operations we are going to learn about, as well as their corresponding operator symbols:
				<ul>
					<li>addition, denoted using <b>+</b></li>
					<li>subtraction, denoted using <b>-</b></li>
					<li>multiplication, denoted using <b>*</b></li>
					<li>division, denoted using <b>/</b></li>
					<li>modulus, denoted using <b>%</b></li>
				</ul>
				<h3>+ addition +</h3>
				<h3>- subtraction -</h3>
				<h3>* multiplication *</h3>
				<h3>/ division /</h3>
				<h3>% modulus %</h3>
				<h3>it do be time for recap</h3>
				<b>gr8!</b> you made it to recap!
				<br/><br/>
				...we know <b className="note">just for java</b> is as <b>addicting</b> as the newest Netflix binge, so what are you waiting for? <b className="pageName">keep coding!</b>
			</div>
		)
	}
}

export default Arithmetic;
